INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (160, 0, 1, 1, 1, 110, 122601, 1, 101, 0, 105, 0.029, 1.5, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (120, 0, 3, 0, 2, 105, 122401, 2, 102, 1, 111, 0.014, 2.5, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (350, 1, 2, 0, 3, 110, 122501, 3, 103, 0, 105, 0.017, 2.5, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (130, 0, 3, 0, 4, 110, 107501, 4, 104, 1, 105, 0.016, 1.5, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (160, 0, 1, 1, 5, 110, 107601, 5, 105, 0, 105, 0.014, 2.5, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (255, 1, 2, 0, 6, 120, 107801, 6, 106, 0, 103, 0.029, 3.5, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (160, 0, 1, 1, 7, 120, 110601, 7, 107, 0, 103, 0.013, 3.5, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (350, 1, 2, 0, 8, 110, 110401, 8, 108, 0, 103, 0.014, 2.5, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (130, 0, 3, 0, 9, 105, 110501, 9, 109, 1, 100, 0.012, 1.5, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (200, 0, 1, 1, 10, 105, 115701, 10, 110, 0, 103, 0.014, 2.5, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (350, 1, 2, 0, 11, 105, 113601, 11, 111, 0, 103, 0.071, 2.5, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (130, 0, 3, 0, 12, 120, 107901, 12, 112, 1, 103, 0.014, 1.5, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (200, 0, 2, 1, 13, 110, 108001, 13, 113, 0, 105, 0.022, 1.5, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (160, 0, 1, 1, 14, 110, 110301, 14, 114, 0, 108, 0.031, 2.5, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (130, 0, 1, 0, 15, 110, 107701, 15, 115, 1, 105, 0.036, 0.5, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (350, 1, 2, 0, 16, 110, 113101, 16, 116, 0, 95, 0.048, 3.5, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (130, 0, 3, 0, 17, 105, 113301, 17, 117, 1, 105, 0.043, 1.5, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (130, 0, 2, 0, 18, 105, 113201, 18, 118, 1, 95, 0.018, 1.5, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (160, 0, 2, 1, 19, 110, 117001, 19, 119, 0, 108, 0.021, 2.5, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (255, 1, 1, 0, 20, 110, 113501, 20, 120, 0, 105, 0.036, 2.5, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (350, 1, 3, 0, 21, 105, 113401, 21, 121, 0, 105, 0.02, 2.5, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (130, 0, 1, 0, 22, 110, 110101, 22, 122, 1, 105, 0.018, 2.5, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (160, 0, 3, 1, 23, 105, 110001, 23, 123, 0, 111, 0.03, 3.5, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (130, 0, 1, 0, 24, 110, 117201, 24, 124, 1, 103, 0.027, 1.5, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (160, 0, 2, 1, 25, 105, 117301, 25, 125, 0, 108, 0.02, 3.5, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (350, 1, 3, 0, 26, 110, 117401, 26, 126, 0, 105, 0.04, 2.5, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (350, 1, 1, 0, 27, 110, 117101, 27, 127, 0, 105, 0.009, 3.5, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (255, 1, 1, 0, 28, 120, 122901, 28, 128, 0, 105, 0.022, 3.5, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (130, 0, 3, 0, 29, 110, 122801, 29, 129, 1, 105, 0.028, 2.5, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？");
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (130, 0, 2, 1, 30, 105, 122701, 30, 130, 0, 108, 0.023, 3.5, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。");
